var _hoisted_1 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<div class=\"border-bottom border-primary container-md overflow-auto\" id=\"voter-registration\"><h1 class=\"text-primary fw-bold text-center\" style=\"margin-top:5%;margin-bottom:5%;\"> Voter Registration Process </h1><ol class=\"list-group list-group-numbered list-group-flush w-md-75 mx-auto\"><li class=\"list-group-item d-flex justify-content-between align-items-start\"><div class=\"ms-2 me-auto\"><div class=\"fw-bold\"> Prepare the COMELEC Registration Requirements </div><p class=\"text-justify\"> For first-time voters, COMELEC registration requirements include at least one of the following valid IDs and a photocopy: </p><div class=\"row container\"><div class=\"col\"><ul><li>Drivers license</li><li>IBP ID</li><li>NBI clearance</li><li>Passport</li><li>Postal ID</li><li>PRC ID</li><li>PWD ID</li></ul></div><div class=\"col\"><ul><li>School ID or library card (for students)</li><li>Senior Citizen ID</li><li>SSS/GSIS ID/UMID</li><li> Certificate of Confirmation from the National Commission on Indigenous Peoples (NCIP) </li><li> Any other valid ID with your photo and signature (except for cedula, police clearance, and barangay clearance/certificate) </li></ul></div></div><p><b>Additional requirements for COMELEC registration:</b> Original and photocopy of birth certificate (for applicants turning 18 years old on the upcoming election day) </p><p><b>Tips:</b></p><ul><li><b>Bring more than one valid ID.</b> Its best to bring as many valid IDs as you have even if you only need one. If the ID you present turns out to be unacceptable, you have back-ups. </li><li><b>Present only a valid ID that shows your current address.</b> If the address on your ID is in a different location than the city or municipality where youre applying, the officer will ask for another ID that indicates your updated address. If you dont have one, your application will be denied. </li></ul></div></li><li class=\"list-group-item d-flex justify-content-between align-items-start\"><div class=\"ms-2 me-auto\"><div class=\"fw-bold\"> Download and Accomplish the Voters Registration Form </div><p> The COMELEC recommends downloading the application forms from its <a href=\"https://comelec.gov.ph/?r=VoterRegistration/ApplicationsForms\">website</a>, printing them, and filling them out manually at home before your registration. However, dont put your signature and thumb marks in advance. The COMELEC requires doing this only in front of the election officer during voters registration. </p><div class=\"fw-bold\">COMELEC Registration Form Guidelines</div><ul><li> Click the <b>CEF-1</b> link to download the voters registration form. Print it on a long bond paper (8.5 x 13). A4 or legal size paper is not allowed. </li><li><b>Annex B (Supplementary Data Form)</b> is for PWDs, senior citizens with disabilities, indigenous people, applicants who cant read or write, or those who will assist such voters. Download this form only if its applicable to you. </li><li> Completing the <b>Coronavirus Self Declaration Form</b> is also a requirement for COMELEC registration. Its best to download and fill it out before you register. </li><li> If you cant access the voters registration forms when the COMELEC website is down, you can download them from the website of COMELEC Spokesperson <a href=\"https://jamesjimenez.com/jabjimenez/registration-forms-download-here/\">James Jimenez</a>. </li></ul></div></li><li class=\"list-group-item d-flex justify-content-between align-items-start\"><div class=\"ms-2 me-auto\"><div class=\"fw-bold\"> Book an Appointment with Your Local COMELEC Office </div><p> As part of its efforts to contain the COVID-19 spread, the COMELEC is processing only a limited number of transactions per day. To make sure your trip to the COMELEC wont turn to waste, contact your local COMELEC office to set an appointment for your voters registration. </p><p> If theres no appointment system in the COMELEC office where youre supposed to register, this means you can do a walk-in application. Come as early as possible so that you can be accommodated within the registration hours. </p></div></li><li class=\"list-group-item d-flex justify-content-between align-items-start\"><div class=\"ms-2 me-auto\"><div class=\"fw-bold\"> Know the COVID-19 Safety Protocols in COMELEC Offices </div><p> The COMELEC registration 2021 is quite different from those done in the past years. Applicants have to follow additional steps to prevent COVID-19 transmission in COMELEC offices. </p><p> So that youll come fully prepared, here are some tips on what to do and bring to the COMELEC registration center: </p><ul><li><b>Dont proceed if you have flu-like symptoms.</b> Applicants with possible COVID-19 symptoms cannot enter COMELEC premises. Go to the COMELEC once you are well and have self-isolated for at least 14 days. </li><li><b>Bring your own pen</b> (black or blue ink).</li><li><b>No face mask and face shield, no registration.</b> Wearing a face mask and face shield at all times (except during photo-taking) inside the premises is a requirement for COMELEC registration. It allows different types of face masks such as surgical masks, reusable masks, DIY cloth masks, and those made of indigenous fabric. </li><li><b>Use the foot bath and hand sanitizer at the entrance.</b> Sanitizing your hands with alcohol is also a requirement for COMELEC registration before and after your biometrics capture. </li><li><b>Use the express lane</b> if youre a senior citizen, PWD, pregnant woman, or 18 to 20 years old. </li></ul><p><b>Ensure physical distancing at all times.</b> Observe at least a 2-meter distance from other people. Leave the COMELEC premises immediately after your registration. </p></div></li><li class=\"list-group-item d-flex justify-content-between align-items-start\"><div class=\"ms-2 me-auto\"><div class=\"fw-bold\">Go to the Local COMELEC Office</div><p> The COMELEC requires Filipinos to personally file their application for voters registration at the Office of the Election Officer or local COMELEC office in the city or municipality where they currently live. Typically, the office is located within or near your city or municipal hall. </p><p> If you dont know where your local COMELEC office is, you may find it through the online directory on the COMELEC website. Alternatively, if you live in Metro Manila, check out this <a href=\"https://www.facebook.com/notes/419644659024618/\"> voters registration center guide </a>. </p></div></li><li class=\"list-group-item d-flex justify-content-between align-items-start\"><div class=\"ms-2 me-auto\"><div class=\"fw-bold\"> Present the Requirements for Voters Registration </div><p> At the COMELEC office, find the queue for submitting the requirements for voters registration. The election officer will check your ID to verify your identity, place of residence, and registration status on the government agencys database. </p><p> Also, submit your accomplished voters registration application forms to the designated officer who will check them for completeness of the information. </p></div></li><li class=\"list-group-item d-flex justify-content-between align-items-start\"><div class=\"ms-2 me-auto\"><div class=\"fw-bold\">Have Your Biometrics Captured</div><p> If your application form is good to go, youll be asked to proceed to the biometrics capture area. Line up at the first queue to have your photo taken. Just look straight at the webcam until the flash appears. You may ask the operator to show you your picture, so you can check if its captured correctly. </p><p> Next, go to the fingerprints capture. On the fingerprint scanner, place your right and left thumbs and index fingers one at a time. The operator will guide you on how to do it properly. </p><p> Lastly, go to the queue for the signature capture. Simply sign on the signature pad, similar to how you sign on paper. Check the computer monitor to see if youve signed correctly. You may repeat this step if your signature was not captured right the first time. </p></div></li><li class=\"list-group-item d-flex justify-content-between align-items-start\"><div class=\"ms-2 me-auto\"><div class=\"fw-bold\">Receive Your Acknowledgment Receipt</div><p> When youre done with your biometrics capture, youll be requested to write down your name and sign on a logbook. Youll then be issued an acknowledgment receipt. </p><p> At this point, youre not a registered voter yet. Your application will undergo approval by the Election Registration Board (ERB) during its scheduled quarterly hearing. After the ERB hearing, your information will be recorded in the book of voters of your district, city, or municipality. Only then can you be considered a registered voter. </p></div></li></ol></div><div class=\"border-bottom border-primary container-md overflow-auto\" id=\"irehistro\"><h2 class=\"text-primary fw-bold text-center\" style=\"margin-top:5%;margin-bottom:5%;\"> COMELEC iRehistro Online Registration </h2><div class=\"w-md-75 mx-auto\"><h4 class=\"text-primary\">What is the COMELEC iRehistro for?</h4><p><a href=\"https://irehistro.comelec.gov.ph/\"><b>iRehistro</b></a> cuts the registration processing time by half, allowing you to fill out forms and book an appointment with the COMELEC online. On the iRehistro site, you can find different types of online application forms for local and overseas applicants. </p><p><a href=\"https://irehistro.comelec.gov.ph/irehistro_local\">Local applicants</a> can accomplish the following online application forms: </p><ul><li>Voters Registration</li><li>Transfer of Registration Record</li><li>Reactivation of Registration Record</li><li> Change of Name due to Marriage or Court Order / Correction of Entries in the Voters Registration Record </li><li> Inclusion of Records in the Book of Voters / Reinstatement of Name in the List of Voters </li></ul><p><a href=\"https://irehistro.comelec.gov.ph/irehistro/ovf1\">For overseas applicants,</a> the following online forms can be accomplished: </p><ul><li>Voters Registration</li><li>Voters Certification</li><li>Transfer / Transfer with Reactivation</li><li> Reinstatement of Name Inadvertently Omitted in the National Registry of Overseas Voters </li><li> Change of Name due to Marriage or Court Order / Correction of Entries in the Voters Registration Record </li><li> Request to Withdraw the Application for Registration / Certification Pending Approval </li><li>Reactivation</li><li>Change of Address (Within the Same Post and Country)</li><li>Updating of Photograph and/or Signature</li></ul><p> However, filling out and submitting these online forms dont mean youve completed the registration process. A personal appearance is a requirement for COMELEC registration, and youll still need to go to the registration center for the biometrics capture. </p></div><div class=\"w-75 mx-auto\"><h4 class=\"text-primary\"> How to Use iRehistro for Voters Registration Online </h4><ol><li> Using Google Chrome or Safari, go to <a href=\"http://www.irehistro.comelec.gov.ph\">www.irehistro.comelec.gov.ph</a>. </li><li>On the Disclaimer pop-up window, click Continue.</li><li>Choose the type of application.</li><li> Supply the required information, especially the ones with the red asterisks. Make sure all information are complete and accurate. </li><li>Choose your birth year, month, and day.</li><li> Enter your address. The address should be where youre currently residing. Make sure that youll be voting in this city or municipality, and its the same address shown on your ID or proof of residency document that youll present when you register to vote. </li><li> Choose the date and time when you want to go to the Office of the Election Officer in your area to submit your application form and biometrics taking. </li><li>Tick the CAPTCHA code box.</li><li> Click on Show Provided Information Details to review and edit the information youve entered. Or click on Proceed if all details are correct. </li></ol><p> Note: The accomplished voters registration form will be automatically downloaded to your smartphone (if youre using a smartphone). You can also download it from your computer. Just follow the printing instructions that can be found on the end screen. </p><p> Print it on a long bond paper and bring it with you on your appointment date. </p></div><div class=\"w-75 mx-auto\"><h4 class=\"text-primary\"> COMELEC Registration 2021 for Overseas Voters </h4><p> Voters registration for Filipinos living and/or working abroad is done differently from those based in the Philippines. Heres how to register with the COMELEC if youre an OFW, immigrant, dual citizen, or abroad during the overseas voting from April 9 to May 9, 2022. </p></div><div class=\"w-75 mx-auto\"><h4 class=\"text-primary\"> COMELEC Registration Schedule and Venue for Overseas Filipinos </h4><p> The registration period for overseas voters is similar to those in the Philippines (September 1, 2020 to September 30, 2021). However, applications for transfer of voters registration were accepted only until August 31, 2021. </p><p> Overseas Filipinos can apply for voters registration from Mondays to Thursdays, 8 a.m. to 4 p.m. through the Office for Overseas Voting (OFOV) located at the COMELEC Main Office (G/F Palacio del Gobernador Bldg., Gen. Luna cor. A. Soriano Ave., Intramuros, Manila). </p><p> Those who are abroad during the entire voters registration period may check with the nearest Philippine embassy or consulate for the overseas voters registration schedule. </p></div><div class=\"w-75 mx-auto\"><h4 class=\"text-primary\"> COMELEC Registration Steps for Overseas Filipinos </h4><ol><li> Schedule an appointment through any of the following: <ul><li><a href=\"www.facebook.com/overseasvotingph\">Office for Overseas Voting PH Facebook page</a> Click the Book Now button or send a private message. </li><li>Email: overseasvoting@comelec.gov.ph</li><li>Landline: (02) 8521-2952 / 8522-2251</li><li>Mobile: (0905) 034-5158 / (0951) 875-9882</li></ul></li><li> The OVOF staff will coordinate with you about your appointment request and refer you to the proper COMELEC registration form. </li><li> Download and fill out the Overseas Voting Form 1 (OVF 1). Leave the Part III blank, as youll have to accomplish this portion in front of a COMELEC officer during your registration. </li><li> Send your accomplished form to the OVOF via email or Facebook private message. </li><li> Wait for a confirmation notice from OFOV. Youll receive an appointment confirmation slip (ACS) containing the transaction details, checklist, and instructions for COMELEC registration. </li><li> On your appointment day, arrive at the COMELEC main office 30 minutes before your scheduled time. </li><li> Present a printout or screenshot of your ACS to the security officer in the building. </li><li>Fill out the Health Declaration Form.</li><li> Present your original passport (or Seamans Book for sea-based OFWs) to the COMELEC representative. </li><li> Undergo biometrics capture. Once done, you will receive an acknowledgment receipt. </li></ol><p> Note: You wont be allowed to register if you dont have a confirmed appointment and not wearing a face mask and face shield. For your safety, follow the COVID-19 protocols being implemented by the COMELEC. </p></div></div>", 2);

